package org.gitee.lidevin.image2base64.utils;

import java.awt.Graphics2D;
import java.awt.Image;
import java.awt.Toolkit;
import java.awt.datatransfer.Clipboard;
import java.awt.datatransfer.DataFlavor;
import java.awt.datatransfer.StringSelection;
import java.awt.datatransfer.Transferable;
import java.awt.image.BufferedImage;
import java.awt.image.RenderedImage;
import java.io.ByteArrayOutputStream;
import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;
import java.text.SimpleDateFormat;
import java.util.Base64;
import java.util.Date;

import javax.imageio.ImageIO;

public class ImageUtil {

	// .jpg/.jpeg/.gif/.bmp/.png/.ico
	public static enum ImageType {
		PNG, JPG, JPEG, GIF, BMP, ICO;
	}

	/**
	 * 将base64转成有道云笔记可用的格式
	 * 
	 * @param base64
	 * @return
	 */
	public static String getYoudaoyunImageUrl(String base64) {
		if (base64 == null || "".equals(base64.trim())) {
			return null;
		}
		String var = "[img" + Long.toHexString(System.currentTimeMillis()).substring(4) + "]";
		StringBuilder sb = new StringBuilder("![image]").append(var).append("\r\n\r\n").append(var).append(":")
				.append(base64);
		return sb.toString();
	}

	/**
	 * 从粘贴板读取image
	 */
	public static Image getClipboardImage() {
		Clipboard clipboard = Toolkit.getDefaultToolkit().getSystemClipboard();
		Transferable cc = clipboard.getContents(null);
		if (cc != null && cc.isDataFlavorSupported(DataFlavor.imageFlavor)) {
			try {
				return (Image) cc.getTransferData(DataFlavor.imageFlavor);
			} catch (Exception e) {
				e.printStackTrace();
			}
		}
		return null;
	}

	/**
	 * 从剪切板获得文字。
	 */
	public static String getClipboardText() {
		Clipboard clipboard = Toolkit.getDefaultToolkit().getSystemClipboard();
		Transferable clipTf = clipboard.getContents(null);
		if (clipTf != null && clipTf.isDataFlavorSupported(DataFlavor.stringFlavor)) {
			try {
				return (String) clipTf.getTransferData(DataFlavor.stringFlavor);
			} catch (Exception e) {

				e.printStackTrace();
			}
		}
		return null;
	}

	/**
	 * 将文件转成base64字符串
	 * 
	 * @param image
	 * @param imageType
	 * @return
	 * @throws IOException
	 */
	public static String imageToBase64(Image image, ImageType imageType) throws IOException {
		if (image == null) {
			return null;
		}
		BufferedImage bi = new BufferedImage(image.getWidth(null), image.getHeight(null), BufferedImage.TYPE_INT_ARGB);
		Graphics2D g = bi.createGraphics();
		g.drawImage(image, null, null);
		g.dispose();
		ByteArrayOutputStream baos = new ByteArrayOutputStream();
		ImageIO.write((RenderedImage) bi, imageType.name().toLowerCase(), baos);// 转输出流
		// 转成base64
		String base64 = Base64.getEncoder().encodeToString(baos.toByteArray());
		return new StringBuilder("data:image/").append(imageType.name().toLowerCase()).append(";base64,").append(base64)
				.toString();
	}

	/**
	 * 将粘贴板图片转成文件
	 * 
	 * @param image
	 * @param path
	 * @param filename
	 * @param imageType
	 * @throws IOException
	 */
	public static void imageToFile(Image image, String path, String filename, ImageType imageType) throws IOException {
		if (image == null) {
			return;
		}
		File file = new File(new StringBuilder(path).append("/").append(filename).append(".")
				.append(imageType.name().toLowerCase()).toString());
		;
		BufferedImage bi = new BufferedImage(image.getWidth(null), image.getHeight(null), BufferedImage.TYPE_INT_ARGB);
		Graphics2D g = bi.createGraphics();
		g.drawImage(image, null, null);
		g.dispose();
		ImageIO.write(bi, imageType.name().toLowerCase(), file);
	}
	public static String fileToBase64(File file) throws IOException {
		String base64 = null;
        try(InputStream in = new FileInputStream(file);) {
            byte[] bytes = new byte[in.available()];
            in.read(bytes);
            base64 = Base64.getEncoder().encodeToString(bytes);
        } catch (Exception e) {
            e.printStackTrace();
        }
		String type = file.getName().substring(file.getName().lastIndexOf('.')+1).toLowerCase();
		return new StringBuilder("data:image/").append(type).append(";base64,").append(base64).toString();
	}
	/**
	 * 将base码转成图片
	 * 
	 * @param base64warp
	 * @param path
	 */
	public static void base64ToFile(String base64warp, String path) {
		String formatname = base64warp.substring(base64warp.indexOf('/') + 1, base64warp.indexOf(';'));
		String base64 = base64warp.substring(base64warp.indexOf(',') + 1);
		byte[] decode = Base64.getDecoder().decode(base64);
		for (int i = 0; i < decode.length; ++i) {
			if (decode[i] < 0) {
				decode[i] += 256;
			}
		}
		StringBuilder sb = new StringBuilder(path);
		sb.append("/img").append(new SimpleDateFormat("yyMMddHHmmss").format(new Date())).append(".").append(formatname);
		OutputStream os = null;
		try {
			os = new FileOutputStream(sb.toString());
			os.write(decode);
		} catch (Exception e) {
			e.printStackTrace();
		} finally {
			try {
				if (os != null) {
					os.close();
				}
			} catch (IOException e) {
				e.printStackTrace();
			}
		}
	}

	/**
	 * 将文本写入到粘贴板
	 */
	public static void textWrite(String text) {
		Clipboard clip = Toolkit.getDefaultToolkit().getSystemClipboard();
		Transferable tText = new StringSelection(text);
		clip.setContents(tText, null);
	}

	public static void main(String[] args) throws IOException {
//		String base64warp = "data:image/png;base64,";
	}
}
